import react, {useState , useEffect} from 'react';
import { UseSelector ,  useDispatch, useSelector } from "react-redux";
import { FormControl, TextField, Button ,Snackbar} from "@mui/material";
import { Container } from "@mui/system";
import { useFormik } from 'formik';
import { getServices } from '../../redux/slices/appointments/thunks';


const NewProfessionalForm = () => {

    const allServices = useSelector((state)=> state.services.services)
    console.log((allServices));
    const dispatch = useDispatch();

    useEffect(()=>{

        dispatch(getServices());

    },[])

    return(
        <h1>formProfessional</h1>
    )



};

export default NewProfessionalForm;
